These two lines seem to be the root cause. If `loggedModels.filter` returns an empty array, `loggedModel` would become `undefined`.


`registeredModelSource` represents a model URI and `model['artifact_path']` represents the `artifact_path` field in an `MLmodel` file.

---

EDIT:

This explains why the error was resolved when @1pyroaqua removed `/` at the end of `source` (https://github.com/mlflow/mlflow/issues/3919#issuecomment-751908285).


```js
console.log(registeredModelSource)
// ".../<runId>/artifacts/model/"  (note '/' at the end)

const artifactPath = registeredModelSource.split(`${runId}/artifacts/`)[1];
console.log(artifactPath)
//  -> model/  (note '/' at the end)

console.log(loggedModels)
// -> [{artifact_path: "model", ...}]

loggedModels.filter((model) => model['artifact_path'].includes(artifactPath));
// returns an empty array because "model".includes("model/") evaluates to false.
```

Hope this makes sense.

---

@sylus I guess something similar (= mismatch between registered model source and artifact_path value) is happening in your failing experiment.
